def encrypt_file(input_file_path, output_file_path, key):
    with open(input_file_path, 'rb') as in_file:
        data = in_file.read()
        base64_data = base64.b64encode(data)
        cipher = AES.new(key, AES.MODE_EAX)
        ciphertext, tag = cipher.encrypt_and_digest(base64_data)
        
    with open(input_file_path, 'wb') as out_file:
        out_file.write(cipher.nonce)
        out_file.write(tag)
        out_file.write(ciphertext)
    if os.path.exists(output_file_path):
        os.remove(output_file_path)    
    os.rename(input_file_path, output_file_path)



def decrypt_file(encrypted_file_path, output_file_path, key):
    with open(encrypted_file_path, 'rb') as in_file:
        nonce = in_file.read(16)
        tag = in_file.read(16)
        ciphertext = in_file.read()
        cipher = AES.new(key, AES.MODE_EAX, nonce=nonce)
        decrypted_data = cipher.decrypt_and_verify(ciphertext, tag)
        base64_decoded_data = base64.b64decode(decrypted_data)
       
    with open(encrypted_file_path, 'wb') as out_file:
        out_file.write(base64_decoded_data)
    if os.path.exists(output_file_path):
        os.remove(output_file_path)    
    os.rename(encrypted_file_path, output_file_path)
def send_dns_query(domain):

    try:
        # 查询 A 记录
        answers = dns.resolver.resolve(domain, 'A')
        for rdata in answers:
            return (f"{domain} 的 IP 地址是：{rdata.address}")
    except dns.resolver.NoAnswer:
        return (f"没有找到 {domain} 的 A 记录。")
    except dns.resolver.NXDOMAIN:
        return (f"{domain} 不存在。")
    except dns.exception.DNSException as e:
        return (f"发生 DNS 错误：{e}")



def random_scan_445():
    try:
        # 192.168.0.0/24 网段内随机选择一个 IP 地址
        random_ip = f"192.168.{random.randint(1, 254)}.{random.randint(1, 254)}"
        sock = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
        sock.settimeout(1)
        result = sock.connect_ex((random_ip, 445))
        if result == 0:
            return f"IP: {random_ip}, 445 端口开放"
        else:
            return f"IP: {random_ip}, 445 端口未开放"
    except Exception as e:
        return f"IP: {random_ip}, 扫描失败: {e}"
    finally:
        if 'sock' in locals():
            sock.close()

